import React from 'react'
import logo from '../img/logo.png'
import './NavBar.css'

const Navbar = () => {
  return (
    <div className='navbar'>
        <img src={logo} alt="" />
        <ul className="nav-menu"></ul>
    </div>
  )
}

export default Navbar
